import React, { Fragment } from "react";
import "./ShowCard.css";
//frame for the anime to show
import { Container, Row, Col } from "react-bootstrap";

function ShowCard(props){
    return(
        <Fragment>
            <Container class="card">
                <Row>
                    <Col id="image">
                        <p>{props.image}</p>
                    </Col>
                    <Col id="description">
                        <Row id="title">
                            <p>{props.name}</p>
                        </Row>
                        <Row id="genres">
                            <p>{props.genre}</p>
                        </Row>
                        <Row id="studio">
                            <p>{props.studio}</p>
                        </Row>
                        <Row id="key_staff">
                            <p>{props.key_staff}</p>
                        </Row>
                    </Col>
                </Row>
            </Container>
        </Fragment>
    );
}

export default ShowCard;
